// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

contract Company {
    uint256[] public Products; // Made Products public for verification function

    mapping(uint256 => bool) public hashcodeToTrue; // Made hashcodeToTrue public

    address public owner;

    constructor(address _owner) {
        owner = _owner;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this function");
        _;
    }

    function addProducts(address _ownerAddress, uint256[] memory _products)
        public
        onlyOwner
        returns (string memory)
    {
        require(_ownerAddress == owner, "Caller is not the owner");
        
        for (uint256 i = 0; i < _products.length; i++) {
            Products.push(_products[i]);
            hashcodeToTrue[_products[i]] = true;
        }

        return "Products added";
    }

    function verifyProduct(uint256 _hashcode)
        public
        view
        returns (string memory)
    {
        if (hashcodeToTrue[_hashcode]) {
            return "Authenticated";
        } else {
            return "Counterfeit";
        }
    }

    function removeProduct(uint256 _hashcode)
        public
        onlyOwner
        returns (string memory)
    {
        require(hashcodeToTrue[_hashcode], "Product not found");

        for (uint256 i = 0; i < Products.length; i++) {
            if (Products[i] == _hashcode) {
                delete Products[i];
                hashcodeToTrue[_hashcode] = false;
                return "Product removed";
            }
        }

        revert("Product not found in the list");
    }

    function getProductCount() public view returns (uint256) {
        return Products.length;
    }
}
